import React from "react";
import "./Company.css";

const Company = () => {
  return (
    <div style={{ padding: "60px" }}>
      <h1>Our Company</h1>
      <p>
        Shopper is an e-commerce platform focused on fashion and lifestyle. 
        We started in 2024 and are growing rapidly with your support.
      </p>
    </div>
  );
};

export default Company;
